import{_ as e,o as a,c as i,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 54.1-2950.1 Advisory Board on Physician Assistants; membership; qualifications.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-2950.1.md","filePath":"vacode/54.1-2950.1.md"}'),s={name:"vacode/54.1-2950.1.md"},t=r('<h1 id="§-54-1-2950-1-advisory-board-on-physician-assistants-membership-qualifications" tabindex="-1">§ 54.1-2950.1 Advisory Board on Physician Assistants; membership; qualifications. <a class="header-anchor" href="#§-54-1-2950-1-advisory-board-on-physician-assistants-membership-qualifications" aria-label="Permalink to &quot;§ 54.1-2950.1 Advisory Board on Physician Assistants; membership; qualifications.&quot;">​</a></h1><p>The Advisory Board on Physician Assistants shall consist of five members to be appointed by the Governor as follows: three members shall be licensed physician assistants who have practiced their professions in Virginia for not less than three years prior to their appointments; one shall be a physician who collaborates with at least one physician assistant; and one shall be a citizen member appointed from the Commonwealth at large. Appointments shall be for four-year terms. Vacancies occurring other than by expiration of term shall be filled for the unexpired term. No person shall be eligible to serve on the Advisory Board for more than two successive terms.</p><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0319" target="_blank" rel="noreferrer">319</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0698" target="_blank" rel="noreferrer">698</a>; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0691" target="_blank" rel="noreferrer">691</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0714" target="_blank" rel="noreferrer">714</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0210" target="_blank" rel="noreferrer">210</a>.</p>',3),o=[t];function n(l,c,h,p,f,d){return a(),i("div",null,o)}const b=e(s,[["render",n]]);export{_ as __pageData,b as default};
